import React from 'react'
import Product from './Product'

function Checkout({basket}) {
    return (
        <div>
            
            {basket.map((x)=>{
                return (<Product
                id={x.id}
                title={x.title}
                image={x.image}
                price={x.price}
                basket={x.basket}
                
                rating={x.rating}
                setbasket={x.setbasket}




                />);
            })}
        </div>
    )
}

export default Checkout
